  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0118741 contains oceanographic
  and surface meteorological data in netCDF formatted files, which follow the Climate
  and Forecast metadata convention (CF) and the Attribute Convention for Data Discovery
  (ACDD). Caro-COOPS collected the data from their in-situ moored station named sun2
  in the North Atlantic Ocean. SECOORA, which assembles data from Caro-COOPS and other
  sub-regional coastal and ocean observing systems of the southeast United States,
  submitted the data to NCEI as part of the Integrated Ocean Observing System Data
  Assembly Centers (IOOS DACs) Data Stewardship Program. Each month, NCEI adds to
  the Accession the data collected during the previous month.\",\n\t\"owner_org\":
